const initialState = {
    currentUser: {},
}

const registerReducer =(state=initialState, action)=>{
    switch(action.type){
        case 'USERS_REGISTER':{
            return {
                  ...state, currentUser: action.payload,
            }
        }
        default:
        return state;

    }
}
export default registerReducer;
